INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('ADD1', 'ADD1 - Insert a single record', 'This will allow the user to add a single record to a database table.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('ADD2', 'ADD2 - Insert a single record', 'This will add an occurrence to the MANY entity in a ONE-to-MANY relationship with the primary key of the ONE entity being passed down from the previous screen.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('ADD3', 'ADD3 - Insert multiple records without user dialog', 'This will add records to the database without any dialog with the user.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('ADD4', 'ADD4 - Insert one or more records without user dialog', 'This will allow one or more database records to be created without any dialog with the user.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('ADD5', 'ADD5 - Insert mutiple records', 'This will allow several database records to be created from a single input screen.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('BATCH', 'BATCH - Background process', 'This process will be run in the background as it may require to run longer than the limit available for web pages. The output will be stored in the LOGS directory.', 'N', 'N', 'N', '2008-11-24 11:39:28', 'AJM', NULL, NULL);
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('DEL1', 'DEL1 - Delete a single record', 'This will delete a single record from the database using the primary key passed down by the previous screen.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('DEL2', 'DEL2 - Delete multiple records without user dialog', 'This will delete multiple records one at a time using the primary keys passed down from the previous screen.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('DEL3', 'DEL3 - Delete multiple records without user dialog', 'This will call the ''deleteSelection'' method to delete/update a selection of records using the primary keys passed down from the previous screen.', 'N', 'Y', 'N', '2003-01-01 12:00:00', 'AJM', '2004-09-08 11:58:29', 'AJM');
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('DEL4', 'DEL4 - Delete parent and children', 'This will allow the user to delete a single record from the parent table, plus all related occurrences from the child table.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('ENQ1', 'ENQ1 - Enquire a single record', 'This will read a single record from the database using the primary key passed down by the previous screen and display it to the user.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('ERASE1', 'ERASE1 - Delete a record and all child records', 'This will delete a single record from the database using the primary key passed down by the previous screen. It will also delete *ALL* related occurrences on child tables.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('FILEDOWNLOAD', 'FILEDOWNLOAD - File Download (local)', 'This will allow the user to download a file from the server to the client. The user selects an entity which contains the name of the file to be downloaded, then activates this transaction by pressing a navigation button.', 'N', 'Y', 'N', '2006-07-26 17:01:40', 'AJM', '2012-11-19 17:00:28', 'AJM');
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('FILEDOWNLOAD2', 'FILEDOWNLOAD2 - File Download (remote)', 'This will allow the user to download a file from a remote server (using FTP) to the client. The user selects an entity which contains the name of the file to be downloaded, then activates this transaction by pressing a navigation button.', 'N', 'Y', 'N', '2012-11-19 17:01:18', 'AJM', '2012-11-19 17:06:49', 'AJM');
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('FILEPICKER', 'FILEPICKER - File Picker (local)', 'This will allow the user to select the name of a file which exists in a local directory.', 'Y', 'N', 'N', '2003-01-01 12:00:00', 'AJM', '2012-11-19 10:14:22', 'AJM');
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('FILEPICKER2', 'FILEPICKER2 - File Picker (remote)', 'This will allow the user to select the name of a file which exists in a remote directory, which will be accessed using the FTP protocol.', 'Y', 'N', 'N', '2012-11-19 10:13:28', 'AJM', NULL, NULL);
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('FILEUPLOAD', 'FILEUPLOAD - File Upload', 'This will allow the user to upload a file from the client to the server. The file can be limited to a range of file types and a maximum size.', 'Y', 'N', 'N', '2005-12-18 14:50:32', 'AJM', NULL, NULL);
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('LINK1', 'LINK1 - Update LINK table', 'This deals with a ONE-to-MANY-to-ONE relationship where MANY indicates a yes/no link between both of the ONE tables.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('LIST1', 'LIST1 - List multiple records', 'This will list all available rows from a database table one page at a time with (usually) 10 rows in each page.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('LIST2', 'LIST2 - List multiple records in a 2-level hierarchy', 'This will list rows of MANY in a ONE-to-MANY relationship one page at a time with (usually) 10 rows in each page.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('LIST3', 'LIST3 - List multiple records in a 3-level hierarchy', 'This will list rows of MANY(1) and MANY(2) in a ONE-to-MANY(1)-to-MANY(2) relationship.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('MENU', 'MENU - Display menu options', 'This will display a list of options and allow the user to select one.', 'Y', 'N', 'N', '2003-01-01 12:00:00', 'AJM', '2004-04-11 16:57:21', 'AJM');
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('MULTI1', 'MULTI1 - Update/Insert/delete multiple records', 'This will take a selection of primary keys and allow individual databases rows to be inserted, updated or deleted.
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('MULTI2', 'MULTI2 - Modify multiple records in a 2-level hierarchy', 'This will allow multiple MANY occurrences in a ONE-to-MANY relationship to be modified in a single operation. 
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('MULTI3', 'MULTI3 - Modify multiple records in a 3-level hierarchy', 'This will allow updates to multiple occurrences of the CHILD table in a GRANDPARENT-PARENT-CHILD relationship n a single operation. 
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('MULTI4', 'MULTI4 - Update both in a ONE-to-MANY relationship', 'This will allow multiple MANY occurrences in a ONE-to-MANY relationship to be modified in a single operation. 
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('MULTI5', 'MULTI5 - Select/Modify multiple rows in a 2-level hierarchy', 'The top zone will act as a selection screen which will provide the selection criteria to populate the bottom zone with multiple occurrences.\n\nThe bottom zone is amendable by default, but can be made read-only.', 'Y', 'Y', 'N', '2013-06-10 13:54:36', 'AJM', '2013-10-26 15:35:24', 'AJM');
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('MULTI6', 'MULTI6 - Select/Modify multiple rows in a 3-level hierarchy', 'The top zone will act as a selection screen which will provide the selection criteria to populate the middle and inner zones with multiple occurrences.\n\nThe middle and inner zones are amendable by default, but can be made read-only.', 'Y', 'Y', 'N', '2013-10-17 13:39:29', 'AJM', NULL, NULL);
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('OTHER', 'Other - Miscellaneous - Undefined', 'This is for anything whch does not fall into any recognisable category.', 'N', 'N', 'N', '2007-01-10 18:21:02', 'AJM', NULL, NULL);
INSERT INTO mnu_pattern (pattern_id, pattern_name, pattern_desc, visible_screen, context_preselect, keep_data, created_date, created_user, revised_date, revised_user) VALUES ('OUTPUT1', 'OUTPUT1 - Output records to a CSV file', 'This will extract all available rows from a database table and output them to a CSV file which will be downloaded to the client device.
